    switchSpacing({ Sw }) {
      try {
        if (typeof Sw == "boolean") this.noSpacing = !Sw;
        if (typeof Sw == "string") {
          Sw = Sw.toLowerCase();
          switch (Sw) {
            case "switch":
              this.noSpacing = !this.noSpacing;
              break;
            case "no":
            case "turn off":
              this.noSpacing = true;
              break;
            case "yes":
            case "turn on":
              this.noSpacing = false;
              break;
            default:
              console.log(Sw);
              break;
          }
        }
      } catch (e) {
        console.log(e);
        return NaN;
      }
    }

